import React,{ useEffect } from "react";
// import { Link } from "react-router-dom";

function Contact() {
    useEffect(() => {
        document.title = 'Contacts us';
    });
    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>Contact</h1>
        </>
    )
}

export default Contact
